import React from 'react';
import './Login.css';
function Login() {
  return (
    <div className="wrapper">
        <div className="container wrapper-box">
            <h2>Login</h2>
            <label></label>
        <input
            type="text"
            placeholder=""
            autoComplete="off"
            
          />
        </div>
    </div>
  )
}

export default Login
